pragma solidity ^0.5.16;

import "./libraries/SafeMath.sol";
import "./libraries/SafeMath32.sol";
import "./libraries/UQ112x112.sol";
import "./interfaces/IUniswapV2Pair.sol";

//TODO ADD EVENTS
//Fuck it: uso l'altro perchè c'è poca differenza e in generale è più semplice ragionare sull'alto

contract SimpleUniswapOracle2 {
	using SafeMath for uint256;
	using SafeMath32 for uint32;
	using UQ112x112 for uint224;

    uint32 internal constant MIN_DELTA = 1800;
		
	struct Pair {
		uint256 priceCumulative;
		uint32 blockTimestamp;
		uint32 freshT;
		uint224 freshMA;
		uint32 oldT;
		uint224 oldMA;
		bool referenceInverted; //if false we use price0 (reserve1/reserve0), else we use price1 (reserve0/reserve1)
	}
	mapping(address => Pair) internal pairs; //TODO make public

	constructor() public {}	

	function toUint224(uint256 input) internal pure returns (uint224) {
		require(input <= uint224(-1), "ImpermaxUniswapOracle: UINT224_OVERFLOW");
		return uint224(input);
	}

	function toUint32(uint256 input) internal pure returns (uint32) {
		require(input <= uint32(-1), "ImpermaxUniswapOracle: UINT32_OVERFLOW");
		return uint32(input);
	}

	function _updateInterval(Pair memory pair, uint224 avg, uint32 T, uint224 priceLast, uint32 priceLastT) internal pure {
		if (MIN_DELTA <= priceLastT) {
			pair.freshT = 0;
			pair.freshMA = 0;
			pair.oldT = MIN_DELTA;
			pair.oldMA = priceLast;
		}
		else if (T.add(pair.freshT) < MIN_DELTA) {
			uint256 num = uint256(avg) * T + uint256(pair.freshMA) * pair.freshT;
			pair.freshT += T;
			pair.freshMA = toUint224(num.div(pair.freshT));
		}
		else if (T < MIN_DELTA) {
			pair.oldT = pair.freshT;
			pair.oldMA = pair.freshMA;
			pair.freshT = T;
			pair.freshMA = avg;
		}
		else {
			pair.freshT = 0;
			pair.freshMA = 0;
			pair.oldT = T;
			pair.oldMA = avg;
		}
	}

	function _update(address uniswapV2Pair) internal returns (Pair memory pair) {
		pair = pairs[uniswapV2Pair];
		uint32 blockTimestamp = getBlockTimestamp();
		if (pair.blockTimestamp == blockTimestamp) return pair;
		(uint112 reserve0, uint112 reserve1, uint32 reserveTimestamp) = IUniswapV2Pair(uniswapV2Pair).getReserves();
		bool notInitialized = (pair.priceCumulative == 0 && pair.blockTimestamp == 0);
		if (notInitialized) pair.referenceInverted = (reserve0 > reserve1);
		uint256 priceCumulativeLast = pair.referenceInverted ? 
			IUniswapV2Pair(uniswapV2Pair).price1CumulativeLast() : IUniswapV2Pair(uniswapV2Pair).price0CumulativeLast();
		uint224 priceLast = pair.referenceInverted ? 
			UQ112x112.encode(reserve0).uqdiv(reserve1) : UQ112x112.encode(reserve1).uqdiv(reserve0);

		if (notInitialized) {
			uint32 T = blockTimestamp - reserveTimestamp;
			pair.priceCumulative = priceCumulativeLast + uint256(priceLast) * T;
			pair.blockTimestamp = blockTimestamp;
			if (T != 0) _updateInterval(pair, priceLast, T, priceLast, T);
		}
		else {
			uint32 priceLastT = blockTimestamp - reserveTimestamp;
			uint32 T = blockTimestamp - pair.blockTimestamp;
			uint256 cumulativeDiff = priceCumulativeLast + uint256(priceLast) * priceLastT - pair.priceCumulative;
			pair.priceCumulative += cumulativeDiff;
			pair.blockTimestamp = blockTimestamp;
			uint224 avg = uint224(cumulativeDiff.div(T));
			_updateInterval(pair, priceLast, T, avg, priceLastT);
		}
		
		pairs[uniswapV2Pair] = pair;
	}
	
	function _calculateResult(Pair memory pair) internal pure returns (uint32 T, uint224 price) {
		T = uint32(pair.freshT).add(pair.oldT);
		require(T >= MIN_DELTA, "SimpleUniswapOracle: NOT_READY");
		uint256 freshCum = uint256(pair.freshMA) * pair.freshT;
		uint256 oldCum = uint256(pair.oldMA) * pair.oldT;
		price = toUint224(freshCum.add(oldCum).div(T));
	}
	
	function _getResult(address uniswapV2Pair) internal returns (uint32 T, uint224 price) {
		Pair memory pair = _update(uniswapV2Pair);
		return _calculateResult(pair);
	}
	
	/*** External ***/
	
	function update(address uniswapV2Pair) external {
		_update(uniswapV2Pair);
	}
	
	function getResult(address uniswapV2Pair) external returns (uint32 T, uint224 price) {
		return _getResult(uniswapV2Pair);
	}

	/*** Utilities ***/
	
	function getBlockTimestamp() internal view returns (uint32) {
		return uint32(block.timestamp % 2**32);
	}
}
